INSERT INTO `mos_categories` VALUES (2,0,'Mambo','Mambo','clock.jpg','com_weblinks','left','A selection of links that are all related to the Mambo project.',1,0,'0000-00-00 00:00:00','',0,0,0,''),(3,0,'Newsflash','Newsflash','','2','left','<strong><em>:: Explanatory Note</em></strong> -- <em>This </em><em>Category, </em><em>and its parent </em><em>Section, </em><em>are not linked\r\nto any menu and therefore are directly viewable on the front end of the\r\nwebsite. Rather the Content Items contained inside this Category are only used to feed items into the NewFlash Module. <u>See also</u>, MODULES&gt;SITE MODULES&gt;NEWSFLASH&nbsp;<strong> </strong></em><strong>::</strong>',1,0,'0000-00-00 00:00:00','',1,0,0,''),(4,0,'Mambo','Mambo','','com_newsfeeds','left','',1,0,'0000-00-00 00:00:00','',4,0,0,''),(14,0,'Web Development','Web Development','','com_newsfeeds','left','',1,0,'0000-00-00 00:00:00','',2,0,0,''),(10,0,'Linux','Linux','','com_newsfeeds','left','<br />\r\n',1,0,'0000-00-00 00:00:00','',5,0,0,''),(13,0,'Open Source','Open Source','','com_newsfeeds','left','',1,0,'0000-00-00 00:00:00','',3,0,0,''),(12,0,'Contacts','Contacts','','com_contact_details','left','Contact Details for this website',1,0,'0000-00-00 00:00:00','',0,0,0,''),(15,0,'General Interest','General Interest','','com_newsfeeds','left','',1,0,'0000-00-00 00:00:00','',1,0,0,''),(16,0,'Getting Started','Getting Started','','4','left','<span class=\"contentheading\">Getting Started</span>\r\n<p><em><strong>:: </strong><strong>Explanatory Note</strong></em> -- This set of content items is\r\nbeing used to demonstrate one way to order content logically and\r\ndisplay it on the page. You see here an example of a &quot;flat&quot; hierarchy\r\nof content. There is only one level of content items, so we created a\r\nSection named &quot;Getting Started&quot; and then we created within that Section\r\na Category with the same name (&quot;Getting Started&quot;). We loaded the\r\ncontent items into the category and then created a Main Menu item named\r\n&quot;Getting Started&quot;. When we created that Menu Item we chose the &quot;Table -\r\nContent Category&quot; format option, which gives us the table layout\r\ncontaining the content items, below. On the Content Items in this\r\nCategory we have used the Content Items Parameters tab to enable the\r\nItem Rating option. Note the Content Item <em>Getting the Most Out of Your Mambo Site</em> demonstrates how to create multi-page content. <em><strong>::</strong></em></p>\r\n\r\n<p>&nbsp;</p>',1,0,'0000-00-00 00:00:00','',1,0,0,''),(17,0,'Managing Users','Managing Users','taking_notes.jpg','3','left','<span class=\"contentheading\">Managing Users</span>\r\n<p><em><strong>:: Explanatory Note</strong></em> -- <em>The Main Menu link &quot;Managing Users&quot; is a child of the parent &quot;FAQs&quot;. Mambo enables you to\r\ncreate sub-menus automatically when you make a new menu\r\nitem. The format selected for this Menu Item is &quot;Table - Content\r\nCategory&quot; which displays a list of the Content Items in a Category in table format.&nbsp; </em><em>Order </em><em>and Filter options are\r\ncontrolled by the Parameters setting for this Menu Item. Throughout\r\nthe Section we use Parameters settings for each Content Item\r\nto display the Back button and to hide the PDF and Print icons.</em> <em><strong>::</strong></em></p>\r\n\r\n<p>&nbsp;</p>',1,0,'0000-00-00 00:00:00','',3,0,0,''),(19,0,'Managing Content','Managing Content','articles.jpg','3','left','<span class=\"contentheading\">Managing Content</span>\r\n<p><em><strong>:: Explanatory Note</strong></em> -- <em>The Main Menu link &quot;Managing Content&quot; is a child of the parent &quot;FAQs&quot;. Mambo enables you to\r\ncreate sub-menus automatically when you make a new menu\r\nitem. The format selected for this Menu Item is &quot;Table - Content\r\nCategory&quot; which displays a list of the Content Items in a Category in table format.&nbsp; </em><em>Order </em><em>and Filter options are\r\ncontrolled by the Parameters setting for this Menu Item. Throughout\r\nthe Section we use Parameters settings for each Content Item\r\nto display the Back button and to hide the PDF and Print icons.</em> <em><strong>::</strong></em></p>\r\n\r\n<p><em><strong /></em></p>\r\n\r\n<p><strong><strong><strong><strong><strong><strong><strong>&nbsp;</strong></strong></strong></strong></strong></strong></strong></p>',1,0,'0000-00-00 00:00:00','',2,0,0,''),(18,0,'Mambo and Security','Mambo and Security','key.jpg','3','left','<span class=\"contentheading\">Mambo and Security</span>\r\n<p><em><strong>:: Explanatory Note</strong></em> -- <em>The Main Menu link &quot;Mambo and\r\nSecurity&quot; is a child of the parent &quot;FAQs&quot;. Mambo enables you to\r\ncreate sub-menus automatically when you make a new menu\r\nitem. The format selected for this Menu Item is &quot;Table - Content\r\nCategory&quot; which displays a list of the Content Items in a Category in table format.&nbsp; Order and Filter options are\r\ncontrolled by the Parameters setting for this Menu Item. Throughout\r\nthe Section we use Parameters settings for each Content Item\r\nto display the Back button and to hide the PDF and Print icons.</em> <em><strong>::</strong></em></p>\r\n\r\n<p>&nbsp;</p>',1,0,'0000-00-00 00:00:00','',1,0,0,'');
