INSERT INTO `mos_content` VALUES (22,'Can I show different users different content?','Can I show different users different content?','Within limits. The Mambo User Manager currently only supports a few\r\nlevels (&quot;groups&quot;) of users. You can show different content to different\r\ngroups, but you cannot show each individual user a unique set of\r\ncontent. Put another way, every user in the group will see the same\r\ncontent as the other users in the group. If you really need this\r\nfunctionality, there are some third party components which add\r\nadditional flexibility.<br />','',0,3,0,17,'2005-11-22 02:16:17',62,'','2005-11-22 07:42:06',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=0\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',4,0,2,'','',0,1),(23,'Can users edit content from the front end?','Can users edit content from the front end?','Yes, if they are registered users who are logged into the system, and\r\nif you have given them permission. There are three user levels which\r\nhave this power:<br />\r\n<ul>\r\n  <li>Author - This group allows a user to post content, usually via a link in the User Menu.</li>\r\n  <li>Editor - This group allows a user to post and edit any content item from the Front-end.</li>\r\n  <li>Publisher - This group allows a user to post, edit and publish any content item from the Front-end.</li>\r\n</ul>','',0,3,0,17,'2005-11-22 02:49:48',62,'','2005-11-22 07:41:41',62,62,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',4,0,1,'','',0,3),(2,'Need Help With Mambo?','','New to Mambo? Looking for help or more information? Visit <a title=\"docs.mambo-foundation.org\" target=\"_blank\" href=\"http://docs.mambo-foundation.org\">Mambo\'s\r\nofficial online help center</a> or join the\r\ndiscussions at <a title=\"forum.mambo-foundation.org\" target=\"_blank\" href=\"http://forum.mambo-foundation.org\">the Mambo Forums</a><a target=\"_blank\" href=\"http://forum.mambo-foundation.org\" />','',0,2,0,3,'2004-08-09 08:30:34',62,'','2005-11-19 21:06:57',62,0,'0000-00-00 00:00:00','2004-08-09 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=\r\nkeyref=\r\ndocbook_type=',6,0,1,'','',0,0),(3,'Extending Mambo','','You can extend the functionality of your Mambo site by installing new\r\nmodules, components or mambots. Additional languages can also be\r\nenabled by installing language packs. Download them free of charge from the <a href=\"http://www.mamboxchange.com\" target=\"_blank\" title=\"MamboXchange\">MamboXchange</a>.<br />','',0,2,0,3,'2004-08-09 08:30:34',62,'','2005-11-19 21:06:32',62,0,'0000-00-00 00:00:00','2004-08-09 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=\r\nkeyref=\r\ndocbook_type=',5,0,2,'','',0,1),(4,'OSI Certified','','Mambo is OSI certified Open Source software. It is free of charge and\r\nis governed by the General Public License (GPL). Learn more about Open\r\nSource and the OSI at <a href=\"http://www.opensource.org\" target=\"_blank\" title=\"Opensource.org\">the Open Source Initiative (OSI) website</a>.','',0,2,0,3,'2004-08-09 08:30:34',62,'','2005-11-19 21:08:20',62,0,'0000-00-00 00:00:00','2004-08-09 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=\r\nkeyref=\r\ndocbook_type=',4,0,3,'','',0,2),(12,'Get Involved','','Would you like to be involved in the Mambo Open Source project? Join\r\nthe Mambo Foundation or become a member of Team Mambo. Learn more by\r\nvisiting <a href=\"http://www.mambo-foundation.org\" target=\"_blank\" title=\"Mambo-Foundation.org\">Mambo-Foundation.org</a>.<a target=\"_blank\" href=\"http://www.mambo-foundation.org\" />','',0,2,0,3,'2005-11-13 16:27:27',62,'','2005-11-19 21:09:33',62,0,'0000-00-00 00:00:00','2005-11-13 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=\r\nkeyref=\r\ndocbook_type=',4,0,4,'','',0,0),(5,'Mambo License Guidelines','','<p><em><strong>:: Explanatory Note</strong></em> -- This page is an example of a\r\nStatic Content Item. The page does not belong to any Section or\r\nCategory. It is found in the Admin system inside the Static Content\r\nManager <em><strong>::</strong></em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n{mosimage}<p>&nbsp;</p>\r\n<p>Mambo\r\nis free software released under the GNU General Public License. A copy\r\nof this license is included with your copy of Mambo and can also be\r\nfound at <a href=\"http://www.fsf.org/licenses/gpl.html\" target=\"_blank\">http://www.fsf.org/licenses/gpl.html</a>. Unofficial translations can also be found at <a href=\"http://www.fsf.org/licenses/translations.html\" target=\"_blank\">http://www.fsf.org/licenses/translations.html</a>.</p>\r\n      \r\n<p><br />\r\n&nbsp;</p>\r\n      \r\n<p><strong>1. Who owns the copyright to Mambo?</strong><br />\r\nThe copyright to the Mambo brand and logo is held by Mambo Foundation,\r\na non profit corporation organized under the laws of Australia and run\r\nby the membership. Copyrights in the code are owned by the authors. You\r\nshould be aware that under the GPL who holds the copyright to the code\r\nbears little relation to the use of the code. The terms of the GPL,\r\nrathe than copyright law, spell out how the code may be used,\r\nmodified,&nbsp; and distributed.<br />\r\n</p>\r\n      \r\n<p><strong>2. Are there any restrictions to your use of Mambo?</strong><br />\r\n        The GNU GPL grants you the freedom to use the software for whatever purpose you see fit.</p>\r\n      \r\n<p><strong>3. May I charge money to distribute Mambo?</strong><br />\r\nThe GPL allows everyone the freedom to do this. The right to charge\r\nmoney to distribute Mambo is part of the definition of &quot;free&quot; software.\r\nWhen people think of &quot;selling software&quot;, they usually imagine doing it\r\nthe way most companies do it, making the software \'proprietary\' rather\r\nthan free. So to avoid ambiguity, you may charge to distribute the\r\nsoftware and any other service you provide along the way. You may not\r\ncharge for the software itself. Remember if someone pays your fee, the\r\nGPL also gives him or her the freedom to pass on the software with or\r\nwithout a fee.</p>\r\n      \r\n<p><strong>4. May I remove &quot;powered by Mambo, Copyright Mambo Foundation&rdquo; from the footer?</strong><br />\r\n        Yes you can, although, we would hope that you would retain it to help spread the word about Mambo.</p>\r\n      \r\n<p><strong>5. May I remove the &quot;copyright&quot; statements from the source code to Mambo?</strong><br />\r\n    No, you must keep all copyright notices and credits in the source code.</p>\r\n      \r\n<p><strong>6. Does the GPL mean that my web site content is also GPL?</strong><br />\r\nNo. The copyright and license of Mambo does not cover the content that\r\nyou create. Using Mambo does not place any restrictions, legally, on\r\nthe license or copyright you use for the content of your web site.</p>\r\n      \r\n<p><strong>7. I have modified Mambo for my own web site. Do I have to release these modifications?</strong><br />\r\nThe GPL permits anyone to make a modified version for their own use\r\nwithout the requirement to distribute it or pass on those changes to\r\nothers.</p>\r\n      \r\n<p><strong>8. I have made a modification (hack) to the Mambo core code. Do I have to release it under the GPL?</strong><br />\r\nIf you chose to distribute your modifications to others it must be\r\nreleased under the same terms that you received the original code. So\r\nyour modifications must be released under the GPL. You may of course in\r\nthis case modify the headers for the source code to include your own\r\ncopyright statement after the original copyright statements. If you do\r\nso, you must clearly annotate in the source code your amendments,\r\nchanges or additions.</p>\r\n      \r\n<p><strong>9. I have written a Component, Module, Template for Mambo. Do I have to release it under the GPL?</strong><br />\r\nNo. The GPL allows you to write your own extensions for Mambo and to\r\nrelease those extensions under whatever license you choose.</p>\r\n      \r\n<p><strong>10.\r\nI have written a Component, Module, Template for Mambo and released it\r\nunder the GPL and I charge a fee for it, but web site X is giving it\r\naway for free! Is that right?</strong><br />\r\n Remember if someone pays your\r\nfee, the GPL also gives him or her the freedom to pass on the software\r\nwith or without a fee because the GNU GPL license must go along with\r\nthe distribution of the software.</p>\r\n      \r\n<p><strong>11. May I purchase a copy of Mambo, which has the copyright statements removed?</strong><br />\r\n        No. Some GPL products are distributed that way (often called &ldquo;dual licensing&rdquo;) but Mambo is not.</p>\r\n      \r\n<p><strong>12. I believe someone is in breach of the GPL, what should I do?</strong><br />\r\n    We would ask you to report it, but please first check all the facts before you send an e-mail to us at: <a href=\"mailto:license-violation@mambo-foundation.org\">license-violation@mambo-foundation.org</a>.</p>\r\n      \r\n<p><strong>13. Who has the power to enforce the GNU GPL license of Mambo?</strong><br />\r\nOnly the copyright holder, Mambo Foundation, has the power to do this.\r\nIf the Mambo Development Team finds, or is made aware of, a breach of\r\nthe GPL, they will report it to the Foundation for them to take any\r\nnecessary action.</p>\r\n      \r\n<p><strong>14.\r\nWeb site X is using or offering my non-GPL Component, Module, Template\r\nwithout my permission, or in breach of its license, can you help me?</strong><br />\r\nWhilst this is not within the remit or responsibility of Mambo, we are\r\nwilling to act as intermediaries in this on your behalf. In most cases\r\nthese situations arise out of simple misunderstandings and can be\r\nsettled amicably. You should e-mail full details to <a href=\"mailto:license-violation@mambo-foundation.org\">license-violation@mambo-foundation.org</a>.</p>\r\n      \r\n<p><strong>15. What about translations of Mambo? Who owns those?</strong><br />\r\n    All translation files, as they are derived works of the original Mambo files, are licensed under the GNU/GPL.<br />\r\n            </p>\r\n      \r\n<p><em>DISCLAIMER<br />\r\nThis document refers to the software program Mambo, Version 4.x and all\r\nsubsequent versions, released under the GNU General Public License and\r\ncopyrighted Mambo Foundation.</em></p>\r\n      \r\n<p><em>This document is subject to additions, modifications and other changes at any time without notice.</em></p>\r\n      \r\n<p><em>A\r\nlawyer has not prepared this document. You should consult a lawyer\r\nexperienced in copyright, licensing and intellectual property for\r\nclarification.</em></p>\r\n      \r\n<p>Document Rev. 1.4 - 16 Nov 2005</p>','',0,0,0,0,'2004-08-19 20:11:07',62,'','2005-11-22 08:19:31',62,0,'0000-00-00 00:00:00','2004-08-19 00:00:00','0000-00-00 00:00:00','opensource-110x95.png|left|OSI Certified|0||bottom||','','menu_image=-1\r\nitem_title=1\r\npageclass_sfx=\r\nback_button=\r\nrating=\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=',1,0,28,'','',0,21),(13,'Getting the Most Out of Your Mambo Site','Getting the Most Out of Your Mambo Site','<em>An introduction to Components, Modules &amp; Mambots</em><br />\r\n<p>\r\nThe default installation of Mambo includes a variety of features\r\nwhich are available for your use at the click of a mouse. Without\r\ninstalling any additional software, you can manage banners, set up\r\nsurveys and polls, syndicate your content, and do many other common\r\ntasks. \r\n</p>\r\n<p>\r\nThe tools that make these functions possible are called Components, Modules and Mambots.\r\n</p>\r\n','<strong>What is the distinction among Components, Modules &amp; Mambots?</strong>\r\n<ul>\r\n	<li>You can consider a <strong>Component</strong> as a full application\r\n	that runs inside Mambo. Components extend Mambo and give it extra\r\n	functionality. The output of a component is displayed inside the main\r\n	content area.</li>\r\n	<li><strong>Modules</strong> are smaller, generally\r\n	&ldquo;helper&rdquo; applications. Some run autonomously, others work in\r\n	cooperation with Components. They are generally displayed around the\r\n	edges of the main content area, in places defined inside the templates\r\n	(called &ldquo;module positions&rdquo;).</li>\r\n	<li><strong>Mambots</strong> are small\r\n	pieces of code that enable a new feature across the entire site. There\r\n	are two types of Mambots: Those that have a visual effect (like\r\n	{mosimage}), and those that affect the way Mambo behaves but without\r\n	adding any true visual impact (like the search Mambots).</li>\r\n</ul>\r\n<p>\r\nJust to make things a bit more confusing, sometimes a function will\r\nrequire a combination of these tools. For example, the Banners and the\r\nPolls functions include both a Component and a Module.\r\n</p>\r\n<p>\r\nWhile the technical distinction between these items is useful\r\ninformation, the most important points concern what they can do, and\r\nhow you can use them. To assist with that, we have provided below a\r\nquick summary of the Components and Modules bundled in your Mambo\r\npackage.{mospagebreak}<br />\r\n</p>\r\n<p>\r\n<strong>A Quick Overview of the Bundled Components</strong>\r\n</p>\r\n<ol>\r\n	<li><strong>Banners</strong>: Controls the Banner ads on your site. This\r\n	component allows you to manage the banners, while the display is\r\n	handled by the Banners Module.</li>\r\n	<li><strong>Mass Mail</strong>: Allows you to send email to all registered users.</li>\r\n	<li><strong>News Feeds</strong>: A tool for managing News Feeds (RSS) to display on your site.</li>\r\n	<li><strong>Polls</strong>: Allows you to create a Poll (Survey) for the visitors to your site. Works in conjunction with the Polls Module.</li>\r\n	<li><strong>Syndicate</strong>: Use this component to format the RSS syndication of your site&rsquo;s contents.</li>\r\n	<li><strong>Web Links</strong>: A component for creating and maintaining\r\n	a &ldquo;Links&rdquo; page for your site.<br />\r\n	</li>\r\n</ol>\r\n{mospagebreak}\r\n<p>\r\n<strong>A Quick Overview of the Bundled Modules </strong>\r\n</p>\r\n<p>\r\nMambo provides for two types of Modules: Site Modules and\r\nAdministrator Modules. The difference between the two has to do with\r\nwhere the modules are displayed. Site Modules are displayed on the\r\nfront end of the site, visible to your visitors. Administrator Modules\r\nare visible only when logged into the Administrator system and are\r\nprimarily intended to make the Admin interface friendlier and more\r\nuseful. We discuss here only the Site Modules. If you wish to learn\r\nmore about the Administrator Modules, please visit our Help Site. \r\n</p>\r\n<p>\r\n<strong>Site Modules</strong>\r\n</p>\r\n<ol>\r\n	<li><strong>Banners</strong>: The Banners module will display banners from the Banners component.</li>\r\n	<li><strong>Main Menu</strong>: This is the module that controls the menu on your site named &ldquo;Main&rdquo;.</li>\r\n	<li><strong>Latest News</strong>: This module shows a list of the most recently published Items.</li>\r\n	<li><strong>User Menu</strong>: This is the module that controls the menu on your site named &ldquo;User&rdquo;.</li>\r\n	<li><strong>Other Menu</strong>: This is the module that controls the menu on your site named &ldquo;Other&rdquo;.</li>\r\n	<li><strong>Login Form</strong>: This module displays a Username and Password login form.</li>\r\n	<li><strong>Syndicate</strong>: The Syndicate module will display a link whereby people can syndicate your site contents (typically via RSS).</li>\r\n	<li><strong>Statistics</strong>: The Statistics module shows information about your server installation and statistics on the web site.</li>\r\n	<li><strong>Template Chooser</strong>:\r\n	The Template Chooser module allows a visitor to change the site\r\n	template on the fly from the front-end via a drop down selection list.</li>\r\n	<li><strong>Archive</strong>: This module shows a list of the calendar months which contain Archived items.</li>\r\n	<li><strong>Sections</strong>: The Section module shows a list of all Sections configured in your database.</li>\r\n	<li><strong>Related Items</strong>: This module displays other Content Items that are related to the Item currently displayed.</li>\r\n	<li><strong>Wrapper</strong>: This module will display an iFrame window in a specified location.</li>\r\n	<li><strong>Polls</strong>: This module compliments the Polls component. It is used to display the Polls.</li>\r\n	<li><strong>Who&rsquo;s Online</strong>: The Who&#39;s Online module displays the number of users that are currently accessing the web site.</li>\r\n	<li><strong>Random Image</strong>: This module displays a random image from a directory.</li>\r\n	<li><strong>Newsflash</strong>: The Newsflash module randomly selects one of the published items from a category upon each page refresh.</li>\r\n	<li><strong>Popular</strong>: This module shows a list of the currently published Items that have been viewed the most.</li>\r\n	<li><strong>Top Menu</strong>: This is the module that controls the menu on your site named &ldquo;Top&rdquo;.</li>\r\n	<li><strong>Search</strong>: This module will display a search box.{mospagebreak}<br />\r\n	</li>\r\n</ol>\r\n<p>\r\n<strong>A Quick Overview of Mambots </strong>\r\n</p>\r\n<p>\r\nAs Mambots are a bit more technical, we ask that you refer to the\r\nHelp site to learn more about what these are and how you can extend the\r\nfunctionality of your site through the use of Mambots. You can find\r\nmore information here: <a href=\"http://help.mamboserver.com/index.php?option=com_content&amp;task=view&amp;id=92&amp;Itemid=121\" target=\"_blank\">http://help.mamboserver.com/index.php?option=com_content&amp;task=view&amp;id=92&amp;Itemid=121</a> \r\n</p>\r\n<strong>How Do I Install Additional Components, Modules or Mambots?{mospagebreak} </strong>\r\n<p>\r\nMambo users enjoy access to a wide variety of extensions for their\r\nsites. Many are free, others are commercial. All can be installed\r\neasily by anyone, without the need for programming skills. To learn\r\nmore about how to install these tools on your site, please visit our\r\nHelp site and read the following:<br />\r\n<a href=\"http://help.mamboserver.com/index.php?option=com_content&amp;task=view&amp;id=149&amp;Itemid=68%20\" target=\"_blank\">http://help.mamboserver.com/index.php?option=com_content&amp;task=view&amp;id=149&amp;Itemid=68 </a><br />\r\n</p>\r\n<p>\r\n<strong>Where Can I Find More Information?</strong>\r\n</p>\r\n<ul>\r\n	<li>Team Mambo maintains a useful Help site: <a href=\"http://docs.mambo-foundation.org\" target=\"_blank\">http://docs.mambo-foundation.org</a> </li>\r\n	<li>A wide selection of free Components, Modules and Mambots can be found at the MamboXchange: <a href=\"http://www.mamboxchange.com\" target=\"_blank\">http://www.mamboxchange.com</a> </li>\r\n	<li>Visit our Forums to get answers to questions and to discuss Mambo issues with the community: <a href=\"http://forum.mambo-foundation.org\" target=\"_blank\">http://forum.mambo-foundation.org</a></li>\r\n</ul>\r\n<p>\r\n&nbsp;\r\n</p>\r\n',0,4,0,16,'2005-11-19 07:25:47',62,'','2008-03-03 09:08:50',62,0,'0000-00-00 00:00:00','2005-11-19 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=1\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=',12,0,3,'','',0,30),(21,'How do I keep track of security advisories?','How do I keep track of security advisories?','Visit the Forums regularly and subscribe to the Mambo Security Announcements mailing list.<br />','',0,3,0,18,'2005-11-22 02:08:13',62,'','2005-11-22 07:34:04',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',5,0,1,'','',0,11),(16,'What is Static Content?','What is Static Content?','Static Content is simply a content item which is not part of a Section\r\nor a Category. Static Content cannot be added to a Blog, a Section or a\r\nCategory. Static Content is, in other words, an independent, stand alone\r\npage. Static Content pages can be created, edited and deleted in the\r\nStatic Content Manager. In the sample content you have installed with\r\nMambo, the Main Menu choice &quot;The Mambo License&quot; shows an example of a\r\nStatic Content page.','',0,3,0,19,'2005-11-22 01:45:07',62,'','2005-11-22 07:41:22',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',11,0,5,'','',0,10),(17,'Do I have to keep this sample content?','Do I have to keep this sample content?','No. This sample content appears because it was selected as an option\r\nduring the installation process. The information contained in the site\r\nis intended to assist new users in learning the system and to help them\r\nget started using Mambo immediately. We have inserted the content using\r\na variety of formats and options to help users get some idea of the\r\nchoices available to them. You may delete any of this content without\r\ncausing any problems to the site installation.<br />','',0,3,0,19,'2005-11-22 01:53:08',62,'','2005-11-22 07:36:23',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',4,0,4,'','',0,1),(18,'What\'s the difference between a Section and a Category?','What\'s the difference between a Section and a Category?','A Category is a subset of a Section. Content Items belong to\r\nCategories; Categories belong to Sections. The only exception to this\r\nhierarchy is Static Content, which exists outside of the Sections &gt;\r\nCategories structure.<br />','',0,3,0,19,'2005-11-22 01:55:35',62,'','2005-11-22 07:35:41',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',5,0,3,'','',0,6),(19,'Why can\'t I delete a Section / Category?','Why can\'t I delete a Section / Category?','A Category must be empty of all Content Items before it can be deleted.\r\nA Section must be empty of all Categories before it can be deleted.\r\nRemember, in Mambo, when you delete an item, it moves to the Trash\r\nManager. To delete it permanently, you must go to the Trash Manager and\r\ndelete the items a second time; only then can you delete the related\r\nCategory / Section.<br />','',0,3,0,19,'2005-11-22 01:58:30',62,'','2005-11-22 07:35:03',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',5,0,2,'','',0,6),(20,'How do I secure my Mambo site?','How do I secure my Mambo site?','A simple question with a complex answer! It is complex because security\r\nissues arise from a variety of sources: your code, your server, the\r\nother things running on your server, the users, etc. While Mambo itself\r\nis relatively secure, you may still experience problems if the server\r\nis compromised or if a user gives up a password. The basic steps you\r\nshould take however include:<br />\r\n<ul>\r\n  <li>Do not unnecessarily leave directories open with CHMOD set at 777 (configuration.php in particular should be set to chmod 644)</li>\r\n  <li>Delete your old installation directory (don\'t just rename it!).</li>\r\n  <li>Implement HTTP access controls for your admin login.</li>\r\n  <li>Make all your admin passwords at least 8 characters and containing symbols and numbers as well as letters.</li>\r\n</ul>\r\nThere\'s more that you can do, but it is outside the scope of this FAQ.<br />','',0,3,0,18,'2005-11-22 02:06:51',62,'','2005-11-22 07:34:45',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',8,0,2,'','',0,7),(24,'Can I change the format of the Home Page?','Can I change the format of the Home Page?','Yes, and it is very easy to do. The formatting of the Home Page -- the\r\nnumber of columns, the number of articles, etc. -- is controlled by the\r\nParameters tab found on the Main Menu Item &quot;Home&quot;. GoTo:\r\nMENU&gt;MAINMENU and select HOME. In the right column you will see the\r\nParameters...<br />','',0,3,0,19,'2005-11-22 07:58:52',62,'','2005-11-22 08:00:27',62,0,'0000-00-00 00:00:00','2005-11-22 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=1\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=\r\nauthor=0\r\ncreatedate=0\r\nmodifydate=0\r\npdf=0\r\nprint=0\r\nemail=\r\nkeyref=\r\ndocbook_type=',2,0,1,'','',0,1),(14,'Using Templates Effectively','Using Templates Effectively','<p>Your Mambo installation comes bundled with a default template and CSS. The template that displays when you first install the site is optimized for screen displays of 1024 x 768 and higher. In addition, we have included a second version of this template optimized for 800 x 600 displays.</p>\r\n<p>Mambo supports a number of options which allow you to change the display of the content on your site, enabling you to achieve a personalized look and feel without having to modify the template file. </p>','<p>The default installation with the sample data is designed to demonstrate a variety of different techniques for formatting information and displaying content. It is a virtual sampler of some of the different tools and techniques made possible by the Mambo system. We have included at the top of most pages ::Explanatory Text:: which helps you understand how that particular page, section or category was created.</p>\r\n<p>Since our goal is to show you ways to use the system, we have not optimized the settings for the most attractive appearance. Moreover, not every site will need the same options we have selected to show you in this sampler.</p>\r\n<p>As a means of extending the examples we have given, here are some changes you might want to consider to help make your site more attractive:\r\n</p>\r\n<ul>\r\n<li>The &quot;Top Menu&quot; can be hidden (it\'s a bit redundant at present,\r\ngiven the choices included and how close they are to the Main Menu)</li>\r\n<li>The &quot;Latest News&quot;and &quot;Popular&quot; modules can be hidden to give the Home Page a cleaner, simpler look.</li>\r\n<li>Experiment with the Parameters controlling the Front Page Component to change the number of articles, columns or links that appear on the Home Page.</li>\r\n<li>Vary the number and types of modules included in the left and right columns and make the selections relevant to the content of the pages on which they appear.</li>\r\n<li>If you use the 800 x 600 version of the template, you may not want to use the &quot;Table - Content Category&quot; or &quot;Table - Content Section&quot; layout options, as the center column becomes very crowded.\r\n</li>\r\n</ul>\r\n<p>If you wish to change the company logo space (&quot;Water &amp; Stone&quot; -\r\nat the top of the template), it is very simple. The present header is an image. The easiest way to replace it is to overwrite the image file via FTP or by using the Media Manager (that is, upload a new file with the same name). If you do not wish to use an image for the company logo, then you will need to edit the template file directly. Changing the image at the top of the template (the wide picture) can be achieved in the same manner.</p>\r\n\r\n<p>If you wish to change the colors of the template you will have to be able to use an image editing program to create new background images (which are tiled to give many of the effects on this template). Changing fonts and font colors is easier as they are all controlled by the CSS.</p>\r\n<p>Note that the template files and the CSS include numerous comment tags that are intended to help make modifying the files faster and easier. The best way to learn how to create or edit Mambo templates is to open one up and experiment. Make copies of the original before you start and you won\'t have any serious problems.</p>\r\n<p>Good Luck and Welcome to Mambo!</p>',0,4,0,16,'2005-11-19 07:34:35',62,'','2005-11-29 21:46:55',62,0,'0000-00-00 00:00:00','2005-11-19 00:00:00','0000-00-00 00:00:00','','','pageclass_sfx=\r\nback_button=\r\nitem_title=1\r\nlink_titles=\r\nintrotext=1\r\nsection=0\r\nsection_link=0\r\ncategory=0\r\ncategory_link=0\r\nrating=1\r\nauthor=\r\ncreatedate=\r\nmodifydate=\r\npdf=\r\nprint=\r\nemail=\r\nkeyref=',6,0,4,'','',0,1),(15,'Î‘ÏÏ‡Î¹ÎºÎ® Î£ÎµÎ»Î¯Î´Î±','Î‘ÏÏ‡Î¹ÎºÎ® Î£ÎµÎ»Î¯Î´Î±','<p>\r\n&Eta; OSCAR O.E. &iota;&delta;&rho;Ï&theta;&eta;&kappa;&epsilon; &sigma;&tau;&eta;&nu; &Epsilon;&lambda;&lambda;Î¬&delta;&alpha; &tau;&omicron;&nu; &Alpha;Ï&gamma;&omicron;&upsilon;&sigma;&tau;&omicron; &tau;&omicron;&upsilon; 1989 &mu;&epsilon;\r\n&epsilon;&pi;&alpha;&gamma;&gamma;&epsilon;&lambda;&mu;&alpha;&tau;&iota;&kappa;Î® &delta;&rho;&alpha;&sigma;&tau;&eta;&rho;&iota;ÏŒ&tau;&eta;&tau;&alpha; &tau;&eta;&nu; &kappa;&alpha;&tau;&alpha;&sigma;&kappa;&epsilon;&upsilon;Î® &Sigma;&upsilon;&nu;&theta;&epsilon;&tau;&iota;&kappa;ÏŽ&nu; &Kappa;&omicron;&upsilon;&phi;&omega;&mu;Î¬&tau;&omega;&nu;, &omicron;&iota;\r\n&iota;&delta;&rho;&upsilon;&tau;Î­&sigmaf; &tau;&et